description:
Full Throttle: The Glory Days of British Motorbikes

Technology Documentary hosted by John Hannah, published by BBC broadcasted as part of BBC Time Shift series in 2013 - English narration


Information
------------------------------

Timeshift explores the British love of fast, daring and sometimes reckless motorbike riding during a period when home-grown machines were the envy of the world. From TE Lawrence in the 1920s, to the 'ton up boys' and rockers of the 1950s, motorbikes represented unparalleled style and excitement, as British riders indulged their passion for brands like Brough Superior, Norton and Triumph.
But it wasn't all thrills and spills - the motorbike played a key role during World War II and it was army surplus bikes that introduced many to the joy and freedom of motorcycling in the 50s, a period now regarded as a golden age. With its obsession with speed and the rocker lifestyle, it attracted more than its fair share of social disapproval and conflict. Narrated by John Hannah.

